import React, {useState,useEffect} from 'react';

import { useParams } from 'react-router-dom';
import { Link } from 'react-router-dom';
import { Row, Col, Image, ListGroup, Button, Card,Form, FormGroup } from 'react-bootstrap';

import axios from 'axios';

import FormContainer from './FormContainer';

function LoginScreen() {

  const [login, setLogin] = useState({
    email : '',
    password:'',
    
});


const handleChange = (event) => {
  const { name, value } = event.target;

  setLogin((prevloginData) => ({
      ...prevloginData,
      [name]: value,
  }));
};

  return (
    <div>
      <FormContainer>
        <h1>Login</h1>
        <Form>
          <Form.Group controlId='email'>
          <Form.Label>Email Address </Form.Label>
          <Form.Control required type='email' placeholder='Enter Email' value={email.email} onChange={''}></Form.Control>
          </Form.Group>

          <Form.Group controlId='password'>
                <Form.Label>Password</Form.Label>
                <Form.Control required type='password' placeholder='Enter Password' value={password.pa} onChange={''}></Form.Control>
              </Form.Group>

           <Button className='mt-3' type='submit' variant='primary'>Sign In</Button>
        </Form>

        <Row className='py-3'>
              <Col>
              New Customer? 
              {/* <Link to={redirect?`/register?redirect=${redirect}`:'/register'}>Register</Link> */}
              </Col>

          </Row>
      </FormContainer>
    </div>
  )
}

export default LoginScreen
